import React from "react";

const App = () => {
  return (
    <div className="app">
      <Navigation />
      <MainContent />
    </div>
  );
};

const Navigation = () => {
  return (
    <nav className="navigation">
      <ul>
        <li>
          <button>Home</button>
        </li>
        <li>
          <button>Doctor Stat</button>
        </li>
        <li>
          <button>Hire Doctor</button>
        </li>
        <li>
          <button>Add Accountant</button>
        </li>
      </ul>
    </nav>
  );
};

const MainContent = () => {
  return (
    <div className="main-content">
      <TopSection />
      <BottomSection />
    </div>
  );
};

const TopSection = () => {
  return <section className="top-section">{/* Content goes here */}</section>;
};

const BottomSection = () => {
  return (
    <div className="bottom-section">
      <LeftPanel />
      <RightPanel />
    </div>
  );
};

const LeftPanel = () => {
  return <div className="left-panel">{/* Content goes here */}</div>;
};

const RightPanel = () => {
  return <div className="right-panel">{/* Content goes here */}</div>;
};

export default App;
